{"de": "**Definition versiegelte / entsiegelte Flächen**

Als versigelte Flächen gelten alle Oberflächen die mittels eines Belages z.B. Asphalt, Schottertränkung, Beton oder andere, wasserundurchlässige Materialien befestigt sind.

Als entsiegelte Flächen gelten alle Oberflächen, deren Belag entfernt und mit einem anderen Material, z.B. sickerfähige Verbundsteine, Gartenplatten, Rasenraster oder ähnliches, ersetzt, oder vollständig renaturiert wird.", "fr": null, "it": null}
